export function return_min_element(numbers){
    let min_element = numbers[0];
    for (let i = 1; i < numbers.length; i++){
        if (typeof numbers[i] !== 'number'){
            var err = new Error('Input must be an array of numbers');
            return err.stack;
        }
        if (numbers[i] < min_element)
            min_element = numbers[i];
    }
    return min_element;
}